import React, { Component } from 'react';
import AlienClockDisplay from './alienClockDisplay';
import SetAlienClockButton from './setAlienClockButton';
import alien from './alien.jpg';

// ...

class AlienClockApp extends Component {
  // ...

  render() {
    const {
      alienYear,
      alienMonth,
      alienDay,
      alienHour,
      alienMinute,
      alienSecond,
    } = this.state;

    return (
      <div className="App">
        <AlienClockDisplay
          alienYear={alienYear}
          alienMonth={alienMonth}
          alienDay={alienDay}
          alienHour={alienHour}
          alienMinute={alienMinute}
          alienSecond={alienSecond}
        />
        <SetAlienClockButton onClick={this.setAlienClock} />
      </div>
    );
  }
}

export default AlienClockApp;
